import React, { useState, useRef } from 'react';
import '../style/Login.css';
import { useHistory } from 'react-router-dom';
import Logo from '../common/Logo';
import TweetBtn from '../common/TweetBtn';


function Register() {
    const form = useRef();
    const [name, setName] = useState('');
    const [phone, setPhone] = useState('');
    const [password, setPassword] = useState('');
    const history = useHistory();

    function handleNameChange(e) {
        setName(e.target.value);
    }
    function handlePasswordChange(e) {
        setPassword(e.target.value);
    }

    async function handleLogin(e) {
        try {
            console.log('handleLogin');
            e.preventDefault();
            history.push('/Home');
        } catch (e) {
        }
    }

    return (
        <div className="login-page">
            <div className="form">
                <form className="login-form" onSubmit={handleLogin} ref={form}>
                    <div className="login-header">
                        <Logo />
                        <h2 className="header">Create your account</h2>
                    </div>
                    <input className="login-input"
                        placeholder="Name"
                        type="text"
                        onChange={handleNameChange}
                    />
                    <input className="login-input"
                        placeholder="Email"
                        type="text"
                        onChange={handleNameChange}
                    />
                    <input className="login-input"
                        placeholder="Phone"
                        type="text"
                        onChange={handleNameChange}
                    />
                    <input className="login-input"
                        placeholder="Password"
                        type="password"
                        onChange={handlePasswordChange}
                    />

                    <TweetBtn content="Create" size="x-large-btn" onClick="handleLogin"/>
                    <p className="message">Already Registered? <a href="/Login">Log In</a> </p>
                </form>
            </div>
        </div>
    );
}



export default Register;
